import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomBasic } from '../Model/Interface';

const host = 'localhost:3001';


const AnalyzeSSR = () => {
  const [data, setData] = useState<{ _id: string; name: string }[]>([]);

  useEffect(() => {
    axios.get('http://localhost:3001/api/getSSRcords')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <table>
        <thead>
          {/* <tr>
            <th>Athlete Name</th>
            <th>Min</th>
            <th>Max</th>
            <th>Average</th>
          </tr> */}
        </thead>
        <tbody>
          {data.map(item => (
            <li key={item._id}>{item.name}</li>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AnalyzeSSR;
